import React from "react";
import "./App.css";
import {BrowserRouter, Route, Routes} from "react-router-dom"
import Home from "./Home";
function App() {
  return (
    <BrowserRouter>
      <div className="homeLayout">
        <Routes>
          <Route path="/" exact element={<Home />}/>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
